original_question:
Двенадцать квадратов размером 1 на 1 образуют прямоугольник, как показано. Какова общая площадь заштрихованной области? [asy]
size(4cm);defaultpen(linewidth(0.75));

// Заштрихованные части
fill((0, 4)--(0, 0)--(2, 0)--cycle, gray(0.75));
fill((0, 4)--(3, 4)--(3, 0)--cycle, gray(0.75));

// сетка
int j;
